Browsers
Usage
npm run build-web or yarn build-web
Reuse the api object for all transactions; it caches ABIs to reduce network usage. Only call new eosjs.Api(...) once.






  let pre = document.getElementsByTagName('pre')[0];
  const defaultPrivateKey = "5JtUScZK2XEp3g9gh7F8bwtPTRAkASmNrrftmx4AxDKD5K4zDnr"; // useraaaaaaaa
  const rpc = new eosjs_jsonrpc.JsonRpc('http://127.0.0.1:8000');
  const signatureProvider = new eosjs_jssig.default([defaultPrivateKey]);
  const api = new eosjs.Api({ rpc, signatureProvider });

  (async () => {
    try {
      const result = await api.transact({
        actions: [{
            account: 'eosio.token',
            name: 'transfer',
            authorization: [{
                actor: 'useraaaaaaaa',
                permission: 'active',
            }],
            data: {
                from: 'useraaaaaaaa',
                to: 'useraaaaaaab',
                quantity: '0.0001 SYS',
                memo: '',
            },
        }]
      }, {
        blocksBehind: 3,
